RAWALPINDI, Dec 10 (APP):Chief of Army Staff (COAS), General Syed Asim Munir has left on Sunday for United States of America (USA) on his maiden official visit.
During his visit, General Syed Asim Munir is scheduled to meet the senior military and other government officials of USA, an Inter Services Public Relations (ISPR) news release said.
